package com.nrk.datastructure;

public class SwapingProgramme {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int x =100;
		int y = 400;
		int temp;
		
		temp = x;
		 
		x = y;
		
		y = temp;
		
		System.out.println(x + " : X  value");
		System.out.println(y + " : Y  value");
	}
}
